chrome.runtime.onMessage.addListener(
    function(request, sender, sendResponse) {    
        
        const selection = request.journal;
        const transformed_selection = selection.toLowerCase().replace('&', 'and');

        var results =  "Journal: " + selection + '\r\n' 
        
        //FT 50
        if(ft_journals.includes(transformed_selection)) {
            results +=  "FT50: Yes \r\n";
        }
        else {
            results +=  "FT50: No \r\n";
        }
        
        //AJG
        var index = AJG_journals.indexOf(transformed_selection);
    
        if(index != -1){
            results += "AJG (ABS): " + AJG_classification[index] + "\r\n";
        }
        else {
            results += "AJG (ABS): No\r\n";
        }

        //ABDC
        index = ABDC_journals.indexOf(transformed_selection);
    
        if(index != -1){
            results += "ABDC: " + ABDC_classification[index] + "\r\n";
        }
        else {
            results += "ABDC: No\r\n";
        }

        sendResponse({display: results});

        return true;
    }
);